import React from 'react';
import styled from 'styled-components';

const MainNavigationItem = styled.div`
  height: 100%;
  position: relative;
`;

const MainNavigationLink = styled.a.attrs({
    href: "#",
    onClick: evt => {
        evt.preventDefault();
    }
})`
  align-items: center;
  color: #999999;
  display: flex;
  flex-flow: row nowrap;
  height: 100%;
  padding: 0 10px;
  text-decoration: none;

  :hover {
    color: #dddddd;
  }
`;

const MainNavigationLinkText = styled.span`
  line-height: 1;
`;

const MainNavigationLinkCaret = styled.svg`
  fill: none;
  margin-left: 0.25em;

  path {
    stroke: currentColor;
  }
`;

const NavigationItem = ({label}) => {
    return (
        <MainNavigationItem>
            <MainNavigationLink>
                <MainNavigationLinkText>{label}</MainNavigationLinkText>
                <MainNavigationLinkCaret
                    height='6'
                    role='img'
                    viewBox='0 0 10 6'
                    width='10'
                    xmlns='http://www.w3.org/2000/svg'
                >
                    <path d="M1 1L5.07223 5.1517L9.23083 1"></path>
                </MainNavigationLinkCaret>

                <MainNavigationLinkDropDown>
                    hello
                </MainNavigationLinkDropDown>

            </MainNavigationLink>
        </MainNavigationItem>

    );
};

export default NavigationItem;
